  false,\n\t\"url\": null,\n\t\"notes\": \"The Ottawa National Wildlife Refuge Complex
  Water Management Plan has been developed to meet the station objectives set forth
  in the Master Plan. Ottawa NWR, Cedar Point NWR, the Darby Division, and the Navarre
  Division are included. This annual water management plan provides guidelines for
  water levels during impoundment rehabilitation, moist soil plant production, and
  spring and fall migrations. The objectives of this comprehensive plan are to ensure
  a diversified habitat is available to a variety of wildlife species throughout the
  planning year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
